<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>WosCosplay</title>
    <style>
        body {
            background-color: white;
            z-index: 1
        }
       .no-copy{
           user-select:none;
           -webkit-user-select:none;
           -moz-user-select:none;
           -ms-user-select:none;
       }
        #content {
            position: absolute;
            z-index: 1;
            top: 10%;
            bottom: 30%;
            left: 20%;
            transform: translate(-20%, 0%);
        }
        .null{
            width: 150px;
            height: 150px;
        }

        h2 {
            font-size: 18px;
        }

        img {
            display: block;
            width: 230px;
            height: 280px;
        }

        #myd2 {
            position: relative;
        }

        #formdiv {
            width: 450px;
        }

        .img {
            position: absolute;
            top: 80px;
            left: -50px;
        }

        input[type="text"] {
            width: 200px;
            padding: 10px;
            border: 2px solid #4CAF50;
            border-radius: 5px;
            font-size: 16px;
            transition: border-color 0.3s;
        }

        input[type="text"]:focus {
            border-color: #f44336;
        }

        .white-button {
            position: fixed;
            z-index: 2;
            top: 20px;
            left: 20px;
            background-color: darkgray;
            border: none;
            border-radius: 20px;
            color: black;
            padding: 5px 10px;
            text-align: center;
            text-decoration: none;
            display: inline-block;
            font-size: 12px;
            margin: 2px 1px;
            cursor: pointer;
        }

        #buttondiv {
            position: fixed;
            z-index: 2;
            bottom: 20px;
            /*left: 20px;*/
            top: 93%;
            left: 50%;
            transform: translate(-50%, -50%);
        }

        .btn-gradient {
            display: block;
            padding: 12px 20px;
            font-size: 20px;
            color: #fff;
            background: linear-gradient(45deg, #6a11cb 0%, #2575fc 100%);
            border: none;
            border-radius: 25px;
            cursor: pointer;
            transition: background 0.3s ease;
        }

        .btn-gradient:hover {
            background: linear-gradient(45deg, #2575fc 0%, #6a11cb 100%);
        }

        #canvadiv {
            position: relative;
            top: -20px;
        }

        @media (max-width: 768px) {
            #myd2 {
                position: relative;
                top: 30px;
                left: 20px;
            }

            .img {
                position: absolute;
                left: 0px;
            }

            #canvadiv {
                left: -310px;
            }
        }

        @media (max-width: 450px) {
            #myd2 {
                position: relative;
                top: 30px;
                left: 10px;
            }

            .img {
                position: absolute;
                left: 30px;
            }

            #canvadiv {
                left: -330px;
            }

            #formdiv {
                position: relative;
                left: 50px;
            }

            /*input[type="text"] {*/
            /*width: 120px;*/
            /*}*/
        }

        dialog {
            position: absolute;
            z-index: 3;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            width: 300px;
            padding: 20px;
            background-color: #f9f9f9;
            border: 1px solid #ccc;
            border-radius: 5px;
            box-shadow: 1px 1px 5px rgba(0, 0, 0, 0.5);
        }

        .close-button {
            float: right;
            cursor: pointer;
        }

        .loading-overlay {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: rgba(0, 0, 0, 0.6);
            z-index: 1000; /* Ensure it's above other content */
        }

        .loader {
            border: 5px solid #f3f3f3; /* Light grey background */
            border-top: 5px solid #3498db; /* Blue border */
            border-radius: 50%;
            width: 50px;
            height: 50px;
            animation: spin 2s linear infinite;
        }
        
        

        .text {
            color: white;
            margin-top: 10px;
            font-size: 16px;
            font-family: Arial, sans-serif;
        }
        
        
        
        

        @keyframes spin {
            0% {
                transform: rotate(0deg);
            }
            100% {
                transform: rotate(360deg);
            }
        }

    </style>
